  <!-- Add more video script tags as needed -->

  <script>
    // Configuration
    var videosPerPage = 10; // Number of videos per page
    var videoData = [];

    // Extract video URLs, widths, and heights from the script tags
    var scriptTags = document.getElementsByTagName('script');
    for (var i = 0; i < scriptTags.length; i++) {
      var scriptTag = scriptTags[i];
      var videoUrl = scriptTag.getAttribute('data-url');
      var videoWidth = scriptTag.getAttribute('data-width');
      var videoHeight = scriptTag.getAttribute('data-height');
      videoData.push({ url: videoUrl, width: videoWidth, height: videoHeight });
    }

    // Function to display videos for the given page number
    function displayVideos(pageNumber) {
      var startIndex = (pageNumber - 1) * videosPerPage;
      var endIndex = startIndex + videosPerPage;

      var videoContainer = document.getElementById('video-container');
      videoContainer.innerHTML = '';

      for (var i = startIndex; i < endIndex && i < videoData.length; i++) {
        var videoDataItem = videoData[i];
        var videoElement = document.createElement('iframe');
        videoElement.src = videoDataItem.url;
        videoElement.style.width = videoDataItem.width;
        videoElement.style.height = videoDataItem.height;
        videoContainer.appendChild(videoElement);
      }
    }

    // Function to handle page change
    function changePage(pageNumber) {
      displayVideos(pageNumber);

      // Update active state of pagination links/buttons
      var paginationLinks = document.querySelectorAll('#pagination a');
      paginationLinks.forEach(function (link) {
        link.classList.toggle('active', link.dataset.page === pageNumber.toString());
      });
    }

    // Generate pagination links/buttons
    var totalPages = Math.ceil(videoData.length / videosPerPage);
    var paginationElement = document.getElementById('pagination');
    for (var i = 1; i <= totalPages; i++) {
      var link = document.createElement('a');
      link.href = '#';
      link.textContent = i;
      link.dataset.page = i;
      link.addEventListener('click', function () {
        var pageNumber = this.dataset.page;
        changePage(pageNumber);
      });
      paginationElement.appendChild(link);
    }

    // Initial video display on the first page
    changePage(1);
  </script>
